package db.domain;import java.util.Arrays;public class UserDataImpl implements UserData {	@Key	private String uname;	private String nick;	private int coupon;	private int gold;	private String invitationCode;	public static final int V_LEN = 40;	private int [] v = new int[40];	public UserDataImpl() {	}	public UserDataImpl(UserData c) {		this.uname = c.getUname();		this.nick = c.getNick();		this.coupon = c.getCoupon();		this.gold = c.getGold();		this.invitationCode = c.getInvitationCode();		for (int i = 0; i < v.length; i++) {
			v[i] = c.getV(i);
		}
	}	@Override	public String tableName() {		return "user_data";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setNick(String nick) {		this.nick = nick;	}	public String getNick() {		return this.nick;	}public void addNick(String nick) {		this.nick += nick;}	public void setCoupon(int coupon) {		this.coupon = coupon;	}	public int getCoupon() {		return this.coupon;	}public void addCoupon(int coupon) {		this.coupon += coupon;}	public void setGold(int gold) {		this.gold = gold;	}	public int getGold() {		return this.gold;	}public void addGold(int gold) {		this.gold += gold;}	public void setInvitationCode(String invitationCode) {		this.invitationCode = invitationCode;	}	public String getInvitationCode() {		return this.invitationCode;	}public void addInvitationCode(String invitationCode) {		this.invitationCode += invitationCode;}	public void setV(int index, int value) {		this.v[index] = value;	}	public int getV(int index) {		return this.v[index];	}}